VALUES ('3760136680749', 'Risotto poulet', 'Risotto cuisiné : eau, riz 18%, crème 13% (dont stabilisant : carraghénanes), oignon, huile d’olive, fond de volaille aromatisé déshydraté (sel, fécule de pomme de terre, arômes naturels, graisse de poulet, plantes aromatiques, poulet, poireau, levure, épices), emmental râpé (lait, sel, ferments, présure, anti-mottant : fécule de pomme de terre), échalote, vin blanc réduit (sulfites), poivre blanc, épaississants : gomme de guar, gomme de xanthane ; Garniture : viande de poulet cuite 16% [viande de poulet (origine : France), sel], morilles 3,4%, petit pois 3,2%, piment, persil.', 'https://static.openfoodfacts.org/images/products/376/013/668/0749/front.6.400.jpg', '7.6', '3.2', '18', '1.2', '', '5.4', '', '', '', '1');

